import React, { useState, useEffect } from "react"
const Converter = () => {


  const apiCall = async () => {
    try {
      const response = await fetch(`https://api.coingecko.com/api/v3/simple/price?ids=bitcoin&vs_currencies=cad,eth`);
      const json = await response.json();
      console.log(json);
    } catch (err) {
      console.log(err);
    }
  };

  useEffect(() => {
    (async () => {
      await apiCall();
    })();
  }, []);

  return(
    <div>
      <ul>
        <li>Bitcoin</li>
        <li>Ethereum</li>
        <li>Dogecoin</li>
        <li>XRP</li>
      </ul>
    </div>
  )
}

export default Converter
